import React from "react";

/**Import core component (variable)*/
import Button from "../../core/Button";
import Drawer from "../../core/Drawer";

export const DEMO = props => {
  const {
    isOpen,
    setOpen,
    position,
    backdrop,
    title
  } = props;
  return (
    <>
<Drawer
  hasBackdrop={true}
  position="right"
  title="This is a drawer"
>
  {/* Content goes here */}
</Drawer>
      <Button
        type={"default"}
        view={"filled"}
        color={"primary"}
        text="Open it"
        onClick={() => setOpen(!isOpen)}
      />
    </>
  );
};
